export class Book {
    bookId:number|undefined;
    flightNumber:number|undefined;

    origin:string|undefined;
    destination:string|undefined;
    flightDate:string|undefined;
    bookingDate !: Date;
    fare: string|undefined;

    status !: string;
    passenger !: Passenger;
    available !:string;
